import React from "react";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";

export default function PrepareCV() {
  return (
    <div>
      <Paper elevation={2}>
        <Typography variant="h4" component="h2">
          h1. Heading
        </Typography>
      </Paper>
    </div>
  );
}
